import React from 'react' ;
import { Container, Row,Button} from 'reactstrap';
import {NacLink,Link} from 'react-router-dom';
import logo from '../../assets/images/logo.png';

const nav_links=[
    {
        path:'/home',
        display:'Home'
    },
    {
        path:'#',
        display:'About'
    },
    {
        path:'/tours',
        display:'Tours'
    },
]

const Header = () => {
    return <header className='header'>
        <Container>
            <Row>
                <div className='nav__wrapper d-flex align-items-center justify-content-between'>
                    {/*===== logo ===== */}
                    <div className='logo'>
                        <img src={logo} alt=""/>   
                    </div>
                    {/*===== logo end ===== */}

                    {/*===== Menu Start ===== */}
                    <div className="navigation">
                        <ul className="menu d-flex align-items">
                                
                        </ul>
                    </div>
                    {/*===== Menu end ===== */}

                </div>
            </Row>
        </Container>
    </header> 

};

export default Header;
